import React, { useState } from "react";
import "./Register.css"; // Assuming you have a separate SCSS file
import Logo from './Logo.png'
import axios from 'axios';
import "bootstrap/dist/css/bootstrap.min.css";
import { useNavigate } from 'react-router-dom';



const leftbox = {
  background: '#344955'
};


const Login = () => {

const [email, setEmail] = useState('');
const [password, setPassword] = useState('');
const [passwordConform, setPasswordConform] = useState('');
const [isLoading, setIsLoading] = useState(false);
const [errorMessage, setErrorMessage] = useState('');
const navigate = useNavigate();


const handleSubmit = async (event) => {
  event.preventDefault(); // Prevent default form submission


  setIsLoading(true); // Set loading state
  setErrorMessage(''); // Clear any previous errors

  try {
    const response = await axios.post('http://localhost:8000/api/employee', {
      email,
      password,
    });

    
    
    

    // Handle successful login (e.g., store token, redirect to dashboard)
    console.log('Login successful:', response.data); // Example logging
    navigate('/home'); 

  } catch (error) {
    setErrorMessage(error.response?.data?.message || 'Login failed');
    console.log("Login Faild..!") // Handle errors gracefully
  } finally {
    setIsLoading(false); // Reset loading state
  }
};

return (

 
      
  <div className='container container d-flex justify-content-center align-items-center min-vh-100'>
      
      {/*--login center--*/}
          <div className='row border rounded-4 p-3 bg-white shadow box-area'>


          {/*--left box--*/}
          <div className="col-md-6 rounded-4 d-flex justify-content-center align-items-center flex-column left-box" style={leftbox}>
              <div className='featured-image mb-3'>
                  <img src={Logo} alt="logo" className = 'img-fluid'style={{width:'500px'}} />
              </div>
              
          </div>

          {/*--right box--*/}

          <div className="col-md-6 rounded-4 rigth-box">
          <form onSubmit={handleSubmit}>
              <div className="row align-items-center">
                  <div className="header-text mb-4">
                      <p className='text-center fs-2'>Business Management System - Register User </p>

                  </div>
                  <div className="input-group mb-3">
                      <input type="text" className='form-control form-control-lg bg-light fs-6' placeholder='Name' value={email}
                      onChange={(e) => setEmail(e.target.value)}/>
                  </div>
                  <div className="input-group mb-3">
                      <input type="text" className='form-control form-control-lg bg-light fs-6' placeholder='Email Address' value={email}
                      onChange={(e) => setEmail(e.target.value)}/>
                  </div>
                  <div className="input-group mb-3">
                      <input type="password" className='form-control form-control-lg bg-light fs-6' placeholder='Password'
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}/>
                  </div>
                  <div className="input-group mb-3">
                      <input type="password" className='form-control form-control-lg bg-light fs-6' placeholder='Password Conform'
                      value={passwordConform}
                      onChange={(e) => setPasswordConform(e.target.value)}/>
                  </div>
                  
                  {/* <div className="input-group mb-5 d-flex justify-content-between">
                      <div className="form-check">
                          <input type="checkbox" className='form-check-input' name="" id="formCheck"  />
                          <label htmlFor="formCheck" className='form-check-lable text-secondary'><small>Rmember Me</small></label>
                      </div>
                      <div className='forgot'>
                          <small><a href="#">Forgot Password?</a></small>
                      </div>
                  </div> */}
                  <div className="input-group mb-3">
                      <button className='btn btn-lg btn-primary w-100 fs-6'type="submit" disabled={isLoading}> {isLoading ? 'Loading...' : 'Register'}</button>
                      {errorMessage && <p className="error-message">{errorMessage}</p>}
                  </div>
                  
                 
              </div>
            </form>
          </div> 
      </div>
    
  </div>
    
)
}

export default Login;
